import React from 'react';

export default class About extends React {

render() {
    return (
      <div>
      <header> Sumanth Pikkili </header>
      Software Developer with 6+ plus years of experience. I specialize in web application development and work on <br />
      Java, REST, ReactJS, Spring, Hibernate. I was born in India and currently live in the United States. I love to travel and <br />
      and have visited more than 15 countries so far.
      </div>
    )
}
}
